import React from 'react';

const Header: React.FC = () => {
  return (
    <header>
      <img src="/logo.png" alt="South Pool Skeptics Logo" />
      <nav>
        <a href="/home">Home</a>
        <a href="/skepticism">Skepticism</a>
        <a href="/contact">Contact</a>
      </nav>
      <h1>South Pool Skeptics</h1>
      <p>Come and chat science, skepticism and critical thinking with a pint and an open mind.</p>
    </header>
  );
};

export default Header;
